// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { AwPwaIncludeRenderFunction } from 'js/AwPwaIncludeService';


/*
ctx imports
*/
import { getSubPanelContextDerivedState as subPanelContextDerivedState } from 'js/AwPwaIncludeService';
const ctxImportObj = { subPanelContextDerivedState };


/*
dynamic import
 */
registerDynImportEntry('js/AwPwaIncludeService', () => import('js/AwPwaIncludeService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "data": {},
    "actions": {
        "render": {
            "method": "AwPwaIncludeRenderFunction",
            "deps": "js/AwPwaIncludeService"
        }
    },
    "conditions": {},
    "onEvent": [],
    "lifecycleHooks": {
        "render": "render"
    },
    "props": {
        "view-base": {
            "type": "object"
        },
        "view": {
            "type": "object"
        },
        "sub-panel-context": {
            "type": "object"
        },
        "show-check-box": {
            "type": "object"
        },
        "selection-model": {
            "type": "object"
        },
        "selection": {
            "type": "object"
        },
        "selection-data": {
            "type": "object"
        }
    },
    "ctx": {
        "subPanelContextDerivedState": {
            "parser": {
                "method": "getSubPanelContextDerivedState",
                "deps": "js/AwPwaIncludeService"
            }
        }
    },
    "_viewModelId": "AwPwaInclude",
    "_uniqueViewModelId": "AwPwaInclude"
};




/*
define component
*/
const Component = createComponent( declViewModelJson, AwPwaIncludeRenderFunction, undefined, ctxImportObj );

export default Component;
